spark.sql("use catalog cyber_catalog")

import os
import re
import json

if "env" not in vars():
  env = "test"

if "cfg" not in vars():
  cfg={}
  cfg["useremail"] = dbutils.notebook.entry_point.getDbutils().notebook().getContext().userName().get()
